import React, { useState, useEffect } from 'react';
import { useDispatch } from 'react-redux';
import { AppDispatch } from '../../store';
import DataTable from '../../components/DataTable';
import Form from '../../components/Form';
import api from '../../services/api';

interface Fee {
  id: number;
  name: string;
  amount: number;
  frequency: 'one-time' | 'monthly' | 'quarterly' | 'annually';
  category: string;
  description: string;
  due_date: string;
  late_fee: number;
  status: 'active' | 'inactive';
}

const Fees: React.FC = () => {
  const dispatch = useDispatch<AppDispatch>();
  const [fees, setFees] = useState<Fee[]>([]);
  const [loading, setLoading] = useState(true);
  const [showForm, setShowForm] = useState(false);
  const [selectedFee, setSelectedFee] = useState<Fee | null>(null);
  const [currentPage, setCurrentPage] = useState(1);
  const [totalPages, setTotalPages] = useState(1);

  const columns = [
    { header: 'Name', accessor: 'name' },
    { header: 'Amount', accessor: 'amount', format: (value: number) => `$${value.toFixed(2)}` },
    { header: 'Frequency', accessor: 'frequency' },
    { header: 'Category', accessor: 'category' },
    { header: 'Due Date', accessor: 'due_date' },
    { header: 'Status', accessor: 'status' },
  ];

  const formFields = [
    { name: 'name', label: 'Fee Name', type: 'text', required: true },
    { name: 'amount', label: 'Amount', type: 'number', required: true, min: 0, step: '0.01' },
    {
      name: 'frequency',
      label: 'Frequency',
      type: 'select',
      options: [
        { value: 'one-time', label: 'One Time' },
        { value: 'monthly', label: 'Monthly' },
        { value: 'quarterly', label: 'Quarterly' },
        { value: 'annually', label: 'Annually' },
      ],
      required: true,
    },
    { name: 'category', label: 'Category', type: 'text', required: true },
    { name: 'description', label: 'Description', type: 'textarea' },
    { name: 'due_date', label: 'Due Date', type: 'date', required: true },
    { name: 'late_fee', label: 'Late Fee', type: 'number', min: 0, step: '0.01' },
    {
      name: 'status',
      label: 'Status',
      type: 'select',
      options: [
        { value: 'active', label: 'Active' },
        { value: 'inactive', label: 'Inactive' },
      ],
      required: true,
    },
  ];

  const fetchFees = async (page: number = 1) => {
    try {
      setLoading(true);
      const response = await api.get(`/fees?page=${page}&limit=10`);
      setFees(response.data.items);
      setTotalPages(Math.ceil(response.data.total / 10));
      setCurrentPage(page);
    } catch (error) {
      console.error('Error fetching fees:', error);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchFees();
  }, []);

  const handleSubmit = async (data: Partial<Fee>) => {
    try {
      if (selectedFee) {
        await api.put(`/fees/${selectedFee.id}`, data);
      } else {
        await api.post('/fees', data);
      }
      setShowForm(false);
      setSelectedFee(null);
      fetchFees(currentPage);
    } catch (error) {
      console.error('Error saving fee:', error);
    }
  };

  const handleEdit = (fee: Fee) => {
    setSelectedFee(fee);
    setShowForm(true);
  };

  const handleDelete = async (fee: Fee) => {
    if (window.confirm('Are you sure you want to delete this fee?')) {
      try {
        await api.delete(`/fees/${fee.id}`);
        fetchFees(currentPage);
      } catch (error) {
        console.error('Error deleting fee:', error);
      }
    }
  };

  return (
    <div className="p-6">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-2xl font-semibold text-gray-900">Fees</h1>
        <button
          className="btn-primary"
          onClick={() => {
            setSelectedFee(null);
            setShowForm(true);
          }}
        >
          Add New Fee
        </button>
      </div>

      <DataTable
        data={fees}
        columns={columns}
        loading={loading}
        currentPage={currentPage}
        totalPages={totalPages}
        onPageChange={fetchFees}
        onEdit={handleEdit}
        onDelete={handleDelete}
      />

      {showForm && (
        <div className="fixed inset-0 bg-gray-600 bg-opacity-50 flex items-center justify-center">
          <div className="bg-white rounded-lg p-6 w-full max-w-2xl">
            <div className="flex justify-between items-center mb-4">
              <h2 className="text-xl font-semibold">
                {selectedFee ? 'Edit Fee' : 'Add New Fee'}
              </h2>
              <button
                className="text-gray-500 hover:text-gray-700"
                onClick={() => {
                  setShowForm(false);
                  setSelectedFee(null);
                }}
              >
                ×
              </button>
            </div>

            <Form
              fields={formFields}
              initialValues={selectedFee || {}}
              onSubmit={handleSubmit}
              onCancel={() => {
                setShowForm(false);
                setSelectedFee(null);
              }}
            />
          </div>
        </div>
      )}
    </div>
  );
};

export default Fees;
